(58, 156, 'Wonderful Watermelon', 'wonderful-watermelon', '<p>Watermelon is a wonderful and healthy treat. We grow the world\'s sweetest watermelon. We have the largest watermelon patch in our country.</p>', '', 1, 30, '2020-02-17 09:27:27', 474, 'Joomla', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2020-02-17 09:27:27', '0000-00-00 00:00:00', '', '', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_readmore\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_hits\":\"\",\"page_title\":\"\",\"alternative_readmore\":\"\",\"layout\":\"\"}', 1, 1, '', '', 1, 0, '', 0, '*', '', ''),
(59, 157, 'Wrapper Module', 'wrapper-module', '<p>This module shows an iframe window to specified location. <a href=\"https://help.joomla.org/proxy/index.php?keyref=Help38:Extensions_Module_Manager_Wrapper\" title=\"Wrapper Module\">Help</a></p><div class=\"sample-module\">{loadmodule wrapper,Wrapper}</div>', '', 2, 67, '2020-02-17 09:27:27', 474, 'Joomla', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2020-02-17 09:27:27', '0000-00-00 00:00:00', '', '', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_readmore\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_hits\":\"\",\"page_title\":\"\",\"alternative_readmore\":\"\",\"layout\":\"\"}', 1, 1, '', '', 1, 0, '', 0, '*', '', ''),
(60, 158, 'News Feeds', 'news-feeds', '<p>News Feeds (com_newsfeeds) provides a way to organize and present news feeds. News feeds are a way that you present information from another site on your site. For example, the joomla.org website has numerous feeds that you can incorporate on your site. You can use menus to present a single feed, a list of feeds in a category, or a list of all feed categories. <a href=\"https://help.joomla.org/proxy/index.php?keyref=Help38:Components_Newsfeeds_Feeds\">Help</a></p>', '', 1, 21, '2020-02-17 09:27:27', 474, 'Joomla', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2020-02-17 09:27:27', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":\"\",\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":\"\",\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":\"\",\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 4, '', '', 1, 6, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(61, 159, 'Breadcrumbs Module', 'breadcrumbs-module', '<p>Breadcrumbs provide a pathway for users to navigate through the site. <a href=\"https://help.joomla.org/proxy/index.php?keyref=Help38:Extensions_Module_Manager_Breadcrumbs\" title=\"Breacrumbs Module\">Help</a></p><div class=\"sample-module\">{loadmodule breadcrumbs,breadcrumbs}</div>', '', 2, 75, '2020-02-17 09:27:27', 474, 'Joomla', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2020-02-17 09:27:27', '0000-00-00 00:00:00', '', '', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\"}', 1, 2, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(62, 160, 'Content', 'content-plugins', '<p>Content plugins run when specific kinds of pages are loaded. They do things ranging from protecting email addresses from harvesters to creating page breaks.</p><p>Default on:</p><ul><li>Email Cloaking <a href=\"https://help.joomla.org/proxy/index.php?keyref=Help38:Extensions_Plugin_Manager_Edit#Content_-_Email_Cloaking\">Help</a></li><li>Load Module <a href=\"https://help.joomla.org/proxy/index.php?keyref=Help38:Extensions_Plugin_Manager_Edit#Content_-_Load_Modules\">Help</a></li><li>Page Break <a href=\"https://help.joomla.org/proxy/index.php?keyref=Help38:Extensions_Plugin_Manager_Edit#Content_-_Pagebreak\">Help</a></li><li>Page Navigation<a href=\"https://help.joomla.org/proxy/index.php?keyref=Help38:Extensions_Plugin_Manager_Edit#Content_-_Page_Navigation\"> Help</a></li><li>Vote <a href=\"https://help.joomla.org/proxy/index.php?keyref=Help38:Extensions_Plugin_Manager_Edit#Content_-_Vote\">Help</a></li></ul>', '', 2, 25, '2020-02-17 09:27:27', 474, 'Joomla', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2020-02-17 09:27:27', '0000-00-00 00:00:00', '', '', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_readmore\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_hits\":\"\",\"page_title\":\"\",\"alternative_readmore\":\"\",\"layout\":\"\"}', 1, 7, '', '', 1, 0, '', 0, '*', '', ''),
