(346, 'COM_PRIVACY_EMAIL_REQUEST_BODY_REMOVE_REQUEST', 'Someone has created a request to remove all personal information related to this email address at [URL]. As a security measure, you must confirm that this is a valid request for your personal information to be removed from this website.\\n\\nIn order to confirm this request, you can complete one of the following tasks:\\n\\n1. Visit the following URL: [TOKENURL]\\n\\n2. Copy your token from this email, visit the referenced URL, and paste your token into the form.\\nURL: [FORMURL]\\nToken: [TOKEN]\\n\\nPlease note that this token is only valid for 24 hours from the time this email was sent.', 'D:\\neard\\www\\Joomla\\language\\en-GB\\en-GB.com_privacy.ini'),
